def get_consolidated_map():
    """
    Returns a merged consolidation map combining all consolidation maps.
    Maps are merged in order (consolidation_map1, consolidation_map2, consolidation_map3, consolidation_map4, etc.).
    In case of key conflicts, later maps take precedence and values are merged avoiding duplicates.
    """
    merged_map = {}
    
    # Get all consolidation maps from globals in order
    consolidation_maps = [
        consolidation_map
    ]
    
    # Merge all maps in order
    for i, current_map in enumerate(consolidation_maps):
        for key, values in current_map.items():
            if key in merged_map:
                # Merge the values, avoiding duplicates
                merged_map[key] = list(set(merged_map[key] + values))
            else:
                merged_map[key] = values.copy()
    
    return merged_map

